(119, 'Baoueb', 'Mohsen amine', 'ISIMM club CRI', 'LabVIEW Interface for Arduino Toolkit', 'NI LabVIEW is a graphical programming environment used by millions of engineers and scientists to develop sophisticated measurement, test, and control systems using intuitive graphical icons and wires that resemble a flowchart. Through the NI LabVIEW Interface for Arduino Toolkit, you can now leverage all of the benefits of NI LabVIEW graphical programming for your Arduino projects.\n\nThe LIFA (LabVIEW Interface for Arduino) toolkit is a free download which allows a LabVIEW developer to easily get data to and from the ever-popular Arduino microcontroller. The basic architecture behind it is that there is an I/O engine programmed to the Arduino which waits for serial commands from LabVIEW and responds with the requested data or action.', 'https://scontent-a-mxp.xx.fbcdn.net/hphotos-frc3/v/t1.0-9/577739_10201276254941305_805469471_n.jpg?oh=510f3f6b3a97ea2dcaf7f34dd962e677&oe=5521AB27', 'mohsen.baoueb@gmail.com', 1),
